export const TaskCard = (props) => {
  return (
    <li
      key={props.task.id}
      className={props.task.completed ? "completed" : "incomplete"}
    >
      <span>
        {props.task.id} - {props.litask.name}
      </span>
      <button
        onClick={() => props.handleDelete(props.task.id)}
        className="delete"
      >
        Delete
      </button>
    </li>
  );
};
